import React from "react";
import styled from "styled-components";


function SearchBar() {
    const Bar = styled.section`
        border: 1px solid black;
        border-radius: 5px;

    `
    return(
        <div>
            <Bar>
            <p>Search</p>

            </Bar>
        </div>
    )
}

export default SearchBar;
